// Dans src/components/Footer.js

import React from 'react';
import efreiLogo from '../path-to-efrei-logo.svg'; // Assurez-vous de remplacer par le chemin correct vers le logo de l'Efrei

function Footer() {
  return (
    <footer className="App-footer">
      <img src={efreiLogo} alt="Efrei Logo" />
      <p>Participants:</p>
      <ul>
        <li>Nom Participant 1</li>
        <li>Nom Participant 2</li>
        <li>Nom Participant 3</li>
        <li>Nom Participant 4</li>
        <li>Nom Participant 5</li>
      </ul>
    </footer>
  );
}

export default Footer;
